import React from 'react'
import { func } from 'prop-types'

function Login () {
  return (
    <>
    <h1>Please Sign In</h1>
    <button>Login</button>
    </>
  )
}

function Guest () {
  return (
    <div>Guest</div>
  )
}

function App (props) {
  const { val, name } = props
  if (val) return <User />
  return <Guest />
}

export default App
